import {useParams } from "react-router-dom"
import NavbarPer from "../navbar/navbar.js"


function PaginaPrincipal () {
    const {idUser} = useParams()

    return(
        <div>
            <NavbarPer idUser={idUser}></NavbarPer>
          
        </div>
    )
}

export default PaginaPrincipal
